import {FloatingLabel, Form} from "react-bootstrap";

function CountryInput({onSearchChange}){
   return (
       <>
           <FloatingLabel
               label="Country"
               className="mb-4 text-secondary">
               <Form.Control
                   label="Cuntry"
                   placeholder="Cuntry"
                   aria-label="Cuntry"
                   className="border-3 border-primary"
                   onChange={onSearchChange}
               />

           </FloatingLabel>
       </>
   );
}

export default CountryInput;
